import Product from "./Product";

const product1 = new Product(1, "Product One", 30.00)
const product2 = new Product(2, "Product Two", 45.99)
const product3 = new Product(3, "Product Three", 67.89)

function getProducts() {
  return [product1, product2, product3]
}

export {getProducts}
